import React, { useState } from 'react';
import Form from './Form';
import Table from './Table';
import Timeline from './Timeline';


const Page = () => {
    const [data, setData] = useState([]);

    const addReserve = (reserve) => {
      setData([...data, reserve]);
    }

    const deleteReserve = (clear) => {
      setData([...data, clear]);
    }

    return (
        <>
            <h1>Reservas</h1>
            <Form addReserve={addReserve} deleteReserve={deleteReserve}/>
            <Timeline data={data}/>
            <Table data={data} />
        </>
    );
};

export default Page;
